import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from '../components/Button';

const Home = () => {
  return (
    <div className="relative overflow-hidden">
      <section className="relative isolate px-4 pt-16 pb-16 sm:pt-24 sm:pb-24 lg:pt-28 lg:pb-28">
        <div className="mx-auto max-w-3xl text-center">
          <h1 className="text-4xl font-extrabold tracking-tight text-gray-900 sm:text-5xl md:text-6xl">
            Welcome to <span className="text-primary-600">Medicare</span>
          </h1>
          <p className="mt-4 text-base sm:text-lg text-gray-600">
            Your smart companion for appointments, symptoms, telemedicine, and more.
          </p>
          <div className="mt-8 flex items-center justify-center gap-3">
            <Link to="/login">
              <Button size="lg">Get Started</Button>
            </Link>
            <Link to="/doctor-finder">
              <Button variant="secondary" size="lg">Find Doctors</Button>
            </Link>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
